import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and enter XSS payload
    const searchInput = await page.waitForSelector('#searchInput', { timeout: 5000 });
    await searchInput.type('<script>alert("XSS")</script>');

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_entered.png'));

    // Click search button using XPath to target the button next to search input
    const searchButton = await page.waitForSelector('xpath=//button[contains(@class, "search-btn") and preceding-sibling::input[@id="searchInput"]]', { timeout: 5000 });
    await searchButton.click();

    // Wait for potential page changes and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract page content to check for XSS reflection
    const pageContent = await page.content();
    const xssReflected = pageContent.includes('<script>alert("XSS")</script>');

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: <script>alert('XSS')</script>",
      extractedData: {
        xssPayloadReflected: xssReflected,
        pageContentLength: pageContent.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS injection attempt",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
